import * as qrCode from "@ibrains-design/qr-code"
import { normalizeProps, useMachine } from "@ibrains-design/solid"
import { createMemo, createUniqueId } from "solid-js"

export function QRCode() {
  const [state, send] = useMachine(
    qrCode.machine({
      id: createUniqueId(),
      value: "https://github.com/chakra-ui",
    }),
  )

  const api = createMemo(() => qrCode.connect(state, send, normalizeProps))

  return (
    <div {...api().getRootProps()}>
      <svg {...api().getFrameProps()}>
        <path {...api().getPatternProps()} />
      </svg>
      <div {...api().getOverlayProps()}>
        <img
          src="https://avatars.githubusercontent.com/u/54212428?s=88&v=4"
          alt=""
        />
      </div>
    </div>
  )
}
